import React from 'react'
import styled from 'styled-components'

const Styles = styled.div`

    .container {
        width: 100%;
        height: 100%;
        background-color: #58A4B0;
    }

    .content {
        position: relative;
        top: 0;
        left: 0;
        bottom:0;
        right:0;
      }
    
    .title {
        color: white;
        font-family: Verdana, Arial, Helvetica, sans-serif;
        text-align: center;
        font-Size: 35px;
        letter-spacing: 3px;
    }
`;

const AboutPage = () => {
    return (
        <Styles>
            <div className="container">
                <div className="content">
                    <p className="title">ABOUT</p>
                    <p>Allison Wu</p>
                    <p>Temple, Texas -> Sacramento, California -> Tampa, Florida -> Gainesville, Florida</p>
                    <p>University of Florida May 2022</p>
                    <p>Began programming at the age of 16</p>
                    <p>Python -> C# -> Java -> C++ -> JS/HTML/CSS</p>
                    <p>Passionate about UX, data science, and software engineering as a whole</p>
                    <p>Hobbies: Animals, kickboxing, discovering music, playing the flute/ukulele, drawing, photography, writing, and spending time with friends/family</p>
                </div>
            </div>
        </Styles>
    )
}

export default AboutPage
